import React from 'react';
import Cruisesbox from './cruisesbox';
import FlightBox from './flightbox';
import {BrowserRouter ,Switch, Route, Link} from 'react-router-dom';


class Mainbox extends React.Component{
    render(){
        const {path} = this.props.match;
        return(
            <div>


                <div id="box" style={{ backgroundColor: "#F8F8FF", borderRadius: "5px"}} >

                    <div className="tabs">
                      <Switch>
                            {/* <FlightBox/> */}
                            <Cruisesbox />


             {/* <Route path={`${path}/Hotels`} exact component={} /> */}
            <Route path={`${path}/flights`} component={FlightBox} />
            {/* <Route path={`${path}/bundle+save`} component={Bundle} />
            <Route path={`${path}/cars`} component={Cars} /> */}
            <Route path={`${path}/cruises`} component={Cruisesbox} />
                      </Switch>

                    </div>



                </div>
            </div>

        );
    }
}

export default Mainbox;
